import React, { useState, useEffect, useCallback, useContext } from 'react';
import axios from 'axios';
import { UserContext } from '../context/UserContext';
import '../App.css';

const DetailedWorkouts = () => {
    const [data, setData] = useState([]);    
    const { user } = useContext(UserContext); // Get user from context

    const fetchWorkouts = useCallback(async () => {
        try {
            const response = await axios.get(`https://localhost:7115/api/WorkoutRecords/user-workouts?username=${user.username}`);
            setData(response.data);
        } catch (error) {
            console.error('Error fetching data:', error);
        }
      }, [user]);

      useEffect(() => {
        if (user) {
            fetchWorkouts();
        }
    }, [user, fetchWorkouts]);
    return(
        <div>
                {data.map((data,) => (
                    <div className="week-info-container">
                        <p>Workout Type: {data.WorkoutType}</p>
                        <p>Duration: {data.Duration} minutes</p>
                        <p>Calories Burned: {data.CaloriesBurned}</p>
                        <p>Intensity: {data.Intensity}</p>
                        <p>Fatigue: {data.Fatigue}</p>
                        <p>Date: {data.WorkoutDate}</p>
                    </div>
                ))}
            </div>
    );
};
export default DetailedWorkouts;
